import { AppBar, Button, Toolbar, Typography } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'

const Navbar = () => {
  return (
    <div>
       <div>
    <AppBar>
        <Toolbar>
          <Typography variant='h6'>myapp</Typography>
          <Button variant="contained" color="success"><Link to='/'style={{color:'white'}}></Link></Button>&nbsp;&nbsp;
          <Button variant="contained" color="success"><Link to='/add'style={{color:'white'}}>ADD</Link></Button>&nbsp;&nbsp;
          <Button variant="contained" color="error"><Link to='/view' style={{color:'white'}}>VIEW</Link></Button>&nbsp;&nbsp;
         
        </Toolbar>
    </AppBar> 
    <br /><br /><br /><br /><br />
    </div>
    </div>
  )
}

export default Navbar
